const httpService = {
    login: (data) => {
        return fetch("http://localhost:3030/user/login",
        {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify(data)
        })
    },
    createUser: (data) => {
        return fetch()
    }
}
